import React, { useState } from "react";

const SpeakerSchedule = () => {
  const [speakerSchedule, setSpeakerSchedule] = useState([]);

  return (
    <div>
      <h2>Speaker Schedule</h2>
      {speakerSchedule.length > 0 ? (
        <ul>
          {speakerSchedule.map((speaker, index) => (
            <li key={index}>{speaker.name} - {speaker.time}</li>
          ))}
        </ul>
      ) : (
        <p>No speakers available.</p>
      )}
    </div>
  );
};

export default SpeakerSchedule;
